import React from "react";
import Toast from "react-bootstrap/Toast";

export default function CourierList({ couriers }) {
  function renderCouriers() {
    return couriers.map((courier, i) => {
      return (
        <div>
          <Toast>
            <Toast.Header>
              <strong className="mr-auto">
                <li key={i}>
                  {courier.name}
                </li>
              </strong>
              <small>
                <li key={i}>
                  {courier.date}
                </li>
              </small>
              
            </Toast.Header>
            <Toast.Body> Arriving to {courier.destination} on {courier.date} </Toast.Body>
          </Toast>
          <ul>
            <li key={i}>
              <h4>Name</h4> {courier.name}
            </li>
            <li key={i}>
              <h4>Destination</h4>
              {courier.destination}
            </li>
            <li key={i}>
              <h4>Date of Arrival</h4>
              {courier.date}
            </li>
          </ul>
        </div>
      );
    });
  }

  return (
    <div>
      <ul>{renderCouriers()}</ul>
    </div>
  );
}
